import Card from '../components/card'
import Layout from '../components/layout'
import fetch from 'node-fetch'



function HomePage() {
  let myTest 
  fetch('http://localhost:3000/api/cors').then(res => res.json())
  .then(json => myTest = json);
  return (
  <Layout>
    <div>
      Welcome to Next.js!
    </div>

  </Layout>
  )
}

export default HomePage
